&lt;p&gt;Tim Robbins, actor and activist joins Aaron Viles of Gulf Restoration Network , the only non profit advocacy group which focuses solely on the Gulf of Mexico, fly over Raccoon Island to assess the oil spill. The barrier island is a bird rookery for numerous species of  including Brown Pelican Louisiana's State bird which was taken off the endangered species list in 2009 . The B.P. oil leak  that started on April 20, 2010, after an explosion at the Deepwater Horizon rig may have catastrophic effects on the environment that was already threatened by coastal erosion.&lt;/p&gt;

